-- ----------------------------
-- Table structure for ccairbag_category
-- ----------------------------
DROP TABLE IF EXISTS `ccairbag_category`;
CREATE TABLE `ccairbag_category`  (
  `category_id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '类目ID',
  `parent_id` bigint(20) UNSIGNED NOT NULL COMMENT '父节点',
  `category_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '产品类目名称',
  `seq` int(5) NOT NULL COMMENT '排序',
  `status` int(1) NOT NULL DEFAULT 1 COMMENT '默认是1，表示正常状态,0为下线状态',
  `rec_time` datetime(0) NOT NULL COMMENT '记录时间',
  `grade` int(2) NOT NULL COMMENT '分类层级',
  `deleted` int(2) NULL DEFAULT NULL COMMENT '是否删除',
  `create_by` int(11) NULL DEFAULT NULL COMMENT '创建该消息的用户 ID，用于记录消息的创建者',
  `create_time` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '消息的创建时间，默认值为当前时间，记录消息生成的时刻',
  `update_by` int(11) NULL DEFAULT NULL COMMENT '最后一次更新该消息的用户 ID，用于追踪消息状态变更的操作者',
  `update_time` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '消息的最后更新时间，当消息状态（如是否已读）发生变化时，该字段会自动更新为当前时间',
  PRIMARY KEY (`category_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

