  `detail_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '订单详情唯一标识，自增主键',
  `order_id` bigint(20) NOT NULL COMMENT '关联的订单 ID',
  `sku_id` bigint(20) NOT NULL COMMENT '关联的 SKU ID',
  `order_number` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '订单号',
  `prod_id` bigint(20) NULL DEFAULT NULL COMMENT '商品id',
  `prod_name` varchar(120) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '产品名称',
  `sku_name` varchar(120) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'sku_name',
  `pic` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '产品主图片路径',
  `quantity` int(11) NOT NULL COMMENT '购买的 SKU 数量',
