  `subtotal` decimal(10, 2) NOT NULL COMMENT '该 SKU 在订单中的小计金额（单价 * 数量）;商品总金额',
  `create_by` int(11) NULL DEFAULT NULL COMMENT '创建该订单详情信息的用户 ID',
  `create_time` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '订单详情信息创建时间，默认当前时间',
  `update_by` int(11) NULL DEFAULT NULL COMMENT '最后一次更新该订单详情信息的用户 ID',
  `update_time` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '订单详情信息最后一次更新时间，自动更新为当前时间',
  `deleted` int(2) NULL DEFAULT NULL COMMENT '是否删除',
  PRIMARY KEY (`detail_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '订单详情' ROW_FORMAT = Dynamic;

