DROP TABLE IF EXISTS `ccairbag_order_payment`;
CREATE TABLE `ccairbag_order_payment`  (
  `payment_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '支付结算单据ID',
  `pay_no` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '支付单号',
  `biz_pay_no` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '外部订单流水号',
  `order_number` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'order表中的订单号',
  `pay_type` int(11) NULL DEFAULT NULL COMMENT '支付方式 1 微信支付 2 支付宝',
  `pay_type_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '支付方式名称',
  `pay_amount` decimal(15, 2) NULL DEFAULT NULL COMMENT '支付金额',
  `is_clearing` int(11) NULL DEFAULT NULL COMMENT '是否清算 0:否 1:是',
  `user_id` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '用户ID',
  `create_time` datetime(0) NOT NULL COMMENT '创建时间',
  `clearing_time` datetime(0) NULL DEFAULT NULL COMMENT '清算时间',
  `version` int(11) NULL DEFAULT NULL COMMENT '版本号',
  `pay_status` int(11) NULL DEFAULT NULL COMMENT '支付状态',
  `deleted` int(2) NULL DEFAULT NULL COMMENT '是否删除',
  PRIMARY KEY (`payment_id`) USING BTREE
