-- ----------------------------
-- Table structure for ccairbag_order_refund
-- ----------------------------
DROP TABLE IF EXISTS `ccairbag_order_refund`;
CREATE TABLE `ccairbag_order_refund`  (
  `refund_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '记录ID',
  `shop_id` bigint(20) NOT NULL COMMENT '店铺ID',
  `order_id` bigint(20) NOT NULL COMMENT '订单ID',
  `order_number` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '订单流水号',
  `order_amount` double(12, 2) NOT NULL COMMENT '订单总金额',
  `order_item_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '订单项ID 全部退款是0',
  `refund_sn` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '退款编号',
  `flow_trade_no` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '订单支付流水号',
  `out_refund_no` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '第三方退款单号(微信退款单号)',
  `pay_type` int(11) NULL DEFAULT NULL COMMENT '订单支付方式 1 微信支付 2 支付宝',
  `pay_type_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '订单支付名称',
  `user_id` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '买家ID',
  `goods_num` int(11) NULL DEFAULT NULL COMMENT '退货数量',
  `refund_amount` decimal(10, 2) NOT NULL COMMENT '退款金额',
  `apply_type` int(11) NOT NULL DEFAULT 0 COMMENT '申请类型:1,仅退款,2退款退货',
  `refund_sts` int(11) NOT NULL DEFAULT 0 COMMENT '处理状态:1为待审核,2为同意,3为不同意',
  `return_money_sts` int(11) NOT NULL DEFAULT 0 COMMENT '处理退款状态: 0:退款处理中 1:退款成功 -1:退款失败',
  `apply_time` datetime(0) NOT NULL COMMENT '申请时间',
  `handel_time` datetime(0) NULL DEFAULT NULL COMMENT '卖家处理时间',
  `refund_time` datetime(0) NULL DEFAULT NULL COMMENT '退款时间',
  `photo_files` varchar(150) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '文件凭证json',
  `buyer_msg` varchar(300) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '申请原因',
  `seller_msg` varchar(300) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '卖家备注',
  `express_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '物流公司名称',
  `express_no` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '物流单号',
  `ship_time` datetime(0) NULL DEFAULT NULL COMMENT '发货时间',
  `receive_time` datetime(0) NULL DEFAULT NULL COMMENT '收货时间',
  `receive_message` varchar(300) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '收货备注',
  `deleted` int(2) NULL DEFAULT NULL COMMENT '是否删除',
  PRIMARY KEY (`refund_id`, `express_no`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '订单退款表' ROW_FORMAT = Dynamic;

