-- ----------------------------
-- Table structure for ccairbag_orders
-- ----------------------------
DROP TABLE IF EXISTS `ccairbag_orders`;
CREATE TABLE `ccairbag_orders`  (
  `order_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '订单唯一标识，自增主键',
  `user_id` bigint(20) NOT NULL COMMENT '下单用户的 ID',
  `total_amount` decimal(10, 2) NOT NULL COMMENT '订单总金额',
  `reduce_amount` decimal(12, 2) NULL DEFAULT NULL COMMENT '优化总额',
  `final_amount` decimal(10, 2) NOT NULL COMMENT '订单最终金额，扣除折扣后的金额',
  `order_status` tinyint(2) NULL DEFAULT 0 COMMENT '订单状态，初始为付款;0: 待付款, 1: 待发货, 2: 待收货, 3: 售后中, 4: 已完成',
  `order_number` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '订单流水号',
  `pay_type` int(2) NOT NULL COMMENT '支付方式',
  `remarks` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  `dvy_type` int(255) NULL DEFAULT NULL COMMENT '配送类型',
  `dvy_id` int(20) NULL DEFAULT NULL COMMENT '配送方式id',
  `dvy_flow_id` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '物流单号',
  `freight_amount` decimal(12, 2) NULL DEFAULT NULL COMMENT '物流运费',
  `addr_id` int(12) NULL DEFAULT NULL COMMENT '用户订单地址Id;用户订单地址Id',
  `product_nums` int(2) NULL DEFAULT NULL COMMENT '订单商品总数',
  `pay_time` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '支付时间',
  `dvy_time` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '发货时间',
  `finally_time` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '完成时间',
  `cancel_time` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '取消时间',
  `delete_status` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '用户订单删除状态;用户订单删除状态，0：没有删除， 1：回收站， 2：永久删除',
  `refund_sts` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '处理状态;0:默认,1:在处理,2:处理完成',
  `close_type` tinyint(2) NULL DEFAULT 0 COMMENT '订单关闭原因;订单关闭原因 1-超时未支付 2-退款关闭 4-买家取消 15-已通过货到付款交易',
  `create_by` int(11) NULL DEFAULT NULL COMMENT '创建该订单信息的用户 ID',
  `create_time` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '订单信息创建时间，默认当前时间',
  `update_by` int(11) NULL DEFAULT NULL COMMENT '最后一次更新该订单信息的用户 ID',
  `update_time` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '订单信息最后一次更新时间，自动更新为当前时间',
  `deleted` int(2) NULL DEFAULT NULL COMMENT '是否删除',
  PRIMARY KEY (`order_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '订单表' ROW_FORMAT = Dynamic;

