  `update_by` int(11) NULL DEFAULT NULL COMMENT '最后一次更新该商品信息的用户 ID',
  `update_time` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '商品信息最后一次更新时间，自动更新为当前时间',
  `version` int(11) NULL DEFAULT 0 COMMENT '乐观锁版本号，用于并发更新控制，初始为 0',
