DROP TABLE IF EXISTS `ccairbag_skus`;
CREATE TABLE `ccairbag_skus`  (
  `sku_id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'SKU 唯一标识，自增主键',
  `product_id` bigint(20) NOT NULL COMMENT '关联的商品 ID，该 SKU 所属商品',
  `sku_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'SKU 名称;如颜色、尺寸等组合',
  `ori_price` decimal(10, 2) NOT NULL COMMENT '原价;原价',
  `price` decimal(10, 2) NOT NULL COMMENT 'SKU 价格，精确到小数点后两位',
  `quantity` int(11) NOT NULL COMMENT 'SKU 库存数量',
  `prod_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '商品名称;商品名称',
  `pic` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'sku图片;sku图片',
  `properties` varchar(2000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '销售属性组合字符串 格式是p1:v1;p2:v2;销售属性组合字符串 格式是p1:v1;p2:v2',
  `weight` double NULL DEFAULT NULL COMMENT '重量',
  `volume` double NULL DEFAULT NULL COMMENT '体积',
  `status` tinyint(2) NULL DEFAULT NULL COMMENT '状态;0 禁用 1启用',
  `deleted` tinyint(2) NULL DEFAULT NULL COMMENT '是否删除;1：删除  0：默认',
  `create_by` bigint(20) NULL DEFAULT NULL COMMENT '创建该 SKU 信息的用户 ID',
  `create_time` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT 'SKU 信息创建时间，默认当前时间',
  `update_by` bigint(20) NULL DEFAULT NULL COMMENT '最后一次更新该 SKU 信息的用户 ID',
  `update_time` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT 'SKU 信息最后一次更新时间，自动更新为当前时间',
  `version` int(11) NULL DEFAULT 0 COMMENT '乐观锁版本号，用于并发更新控制，初始为 0',
  PRIMARY KEY (`sku_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = 'sku表' ROW_FORMAT = Dynamic;

