务订单页面中所包含的全部内容，包括但不限于上述服务信息中的全部内容、您要注意而标明的本单服务内容、服务有效期、选择及确认服务内容、数量、价格、应付总额、用户的联系方式或地址和服务时间等内容。前述服务订单页面中所包含的全部内容，构成了（您）达人与用户之间达成的服务合同内容，将视为用户的邀约，您在完全同意服务订单的全部内容后方可提交订单', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-07-30 18:05:21', 5);
