INSERT INTO `sys_oper_log` VALUES (332, '静态资源', 1, 'com.ruoyi.system.controller.DdtyStaticController.add()', 'POST', 1, 'admin', NULL, '/static', '127.0.0.1', '', '{\"content\":\"<strong>平台服务协议</strong>&nbsp;最后更新和生效时间： 2024年3&nbsp;月30&nbsp;日&nbsp;<strong>提示条款：</strong>&nbsp;欢迎您（“用户”）与淘老猫平台（详见定义条款）签署本《平台服务协议》（下称“本协议”）并使用淘老猫平台服务！&nbsp;本协议为《平台服务协议》修订版本，自本协议发布之日起，淘老猫平台各处所称“平台服务协议”均指本协议。&nbsp;各章节标题仅为帮助您理解该条款表达的主旨之用，不影响或限制本协议条款的含义或解释。为维护您自身权益，建议您仔细阅读各条款具体表述。&nbsp;您在登录流程中点击同意本协议之前，应当认真阅读本协议。请您务必阅读、理解本协议各条款内容，特别是免除或者限制责任的条款、法律适用和争议解决条款。您应重点阅读加粗显示的条款。如您对协议有任何疑问，可联系我们进行咨询。&nbsp;当您按照页面提示填写信息、阅读并同意本协议且完成全部流程后，即表示您已充分阅读、理解并接受本协议的全部内容，并与淘老猫达成一致，成为淘老猫平台“用户”。阅读本协议的过程中，如果您不能理解或不同意本协议或其中任一条款的约定，您应立即停止使用。&nbsp;由于互联网的高速发展，现有的约定可能不符合将来双方的需求，因此我们可能会修订本协议和（或）其补充协议。我们如修改本协议和（或）其补充协议，将通过页面弹窗、公告等方式通知您，请您仔细阅读并同意修改后的协议后再继续使用本软件或相关服务。&nbsp;请您注意，我们提供的服务属于短期工信息发布，任何满十八岁的用户都可以在淘老猫平台流量和使用短期找工信息。&nbsp;<strong>1.定义</strong>淘老猫平台：由海南八沁网络科技有限公司（下称“我们”）开发的网络平台，包括但不限于移动端网站、微信公众号、小程序、APP。&nbsp;淘老猫：淘老猫平台经营者的单称或合称。&nbsp;淘老猫平台服务：淘老猫基于互联网，以包含淘老猫平台手机端网站、微信公众号、小程序、APP等在内的各种形态（包括未来技术发展出现的新的服务形态）向您提供的各项服务。&nbsp;用户：指使用淘老猫平台的任何人。&nbsp;<strong>2.协议适用范围</strong>2.1 签约主体&nbsp;本协议由您与淘老猫平台经营者共同缔结，本协议对双方均具有约束力。&nbsp;淘老猫平台经营者是指经营淘老猫平台法律主体，您可随时查看淘老猫平台公示的证照信息以确定与您履约的主体。本协议项下，淘老猫平台经营者可能根据淘老猫平台的业务调整而发生变更，变更后的淘老猫平台经营者与您共同履行本协议并向您提供服务，淘老猫平台经营者的变更不会影响您本协议项下的权益。发生争议时，您可根据您具体使用的服务及对您权益产生影响的具体行为对象确定与您履约的主体及争议相对方。&nbsp;2.2 补充协议&nbsp;我们另行制定了《法律声明》《隐私政策》《软件许可使用协议》作为本协议的补充协议，补充协议与本协议不可分割且具有同等法律效力。如您使用淘老猫平台服务，视为您同意上述补充协议。&nbsp;<strong>3.&nbsp;账户注册与使用</strong>&nbsp;3.1 用户资格&nbsp;我们的平台主要面向成年人提供服务。若您主动使用我们的平台，我们推定您是成年人并具有完全民事行为能力。&nbsp;若您是不满十八周岁的未成年人或因智力因素而不具有完全民事行为能力，我们要求您的父母或监护人仔细阅读本协议，在没有得到您的父母或监护人的同意前提下，您不得使用我们的产品或服务。若您不具备前述与您行为相适应的民事行为能力，您及您的监护人将承担由此导致的一切后果。 &nbsp;若您是未成年人或因智力因素而不具有完全民事行为能力的人的父母或监护人，请您关注该未成年人或因智力因素而不具有完全民事行为能力的人是否是在取得您的授权同意之后使用我们的产品或服务。&nbsp;请您注意，我们不面向十八周岁以下儿童提供服务。&nbsp;3.2 &nbsp;账户说明&nbsp;1.当您按照登录页面提示填写信息、阅读并同意本协议且完成全部注册程序后，您可获得淘老猫平台账户并成为淘老猫平台用户；&nbsp;2.您有权使用微信登录或其他我们认可的方式登录淘老猫平台；&nbsp;3.由于您的淘老猫平台账户关联您的个人信息及淘老猫平台商业信息，您的淘老猫平台账户仅限您本人使用。未经淘老猫平台同意，您直接或间接授权第三方使用您淘老猫平台账户或获取您账户项下信息的行为无效，上述行为造成淘老猫平台损失或支出额外费用的，我们有权要求您赔偿或补偿；&nbsp;4.作为淘老猫平台经营者，为使您更好地使用淘老猫平台的各项服务，保障您及您的账户安全，必要时，淘老猫可以要求您按相关法律法规', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-07-30 18:11:36', 4);
INSERT INTO `sys_oper_log` VALUES (333, '静态资源', 2, 'com.ruoyi.system.controller.DdtyStaticController.edit()', 'PUT', 1, 'admin', NULL, '/static', '127.0.0.1', '', '{\"content\":\" 防止XSS攻击，主要是由于ruoyi为了防止xss攻击，导致了部分标签被屏蔽掉了\\nxss:\\n  # 过滤开关\\n  enabled: true\\n  # 排除链接（多个用逗号分隔），在此处写入富文本表单提交的接口，将链接屏排除\\n  excludes: /system/notice/*,/system/news/*\\n  # 匹配链接\\n  urlPatterns: /system/*,/monitor/*,/tool/*\\n\",\"id\":1,\"params\":{},\"title\":\"达人使用协议\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-07-30 18:12:37', 4);
INSERT INTO `sys_oper_log` VALUES (334, '静态资源', 2, 'com.ruoyi.system.controller.DdtyStaticController.edit()', 'PUT', 1, 'admin', NULL, '/static', '127.0.0.1', '', '{\"content\":\"<strong>达人使用协议</strong>用户使用协议版本日期：2024年3月25日发布日期：2024年3月25日使用须知：您在注册、使用本平台时，应当仔细认真阅读《用户使用协议》（可能涉及相关方的权利义务关系的确认、责任免除或限制、法律适用与争议解决条款，请您重点阅读，对于加黑部分犹请特别关注）。本协议由海南八沁网络科技有限公司（以下也称：平台方），与您达成的关于使用淘老猫平台服务的各项条款。您点击同意本协议，即表示您已充分阅读、理解，并接受本协议的全部内容，成为淘老猫平台达人，本协议对双方均具有法律约束力。一、达人账号注册您应遵循诚实信用、合法善意的原则，向平台提交注册资料，相关注册资料应当合法合规，真实有效。如果因您所提供的注册资料不合法、不真实、不准确，从而导致相关法律责任或不利后果的，将由您承担。二、账号使用您可通过注册新的平台账号或登录您已有的平台账号以使用平台上现有的各项服务及功能。您应对您账号项下的所有行为（包括但不限于在线签署任何协议，浏览、购买、支付、服务、上传、发布、输入任何内容）所产生的一切后果负责，您不应当将账号借给他人使用，通过您的账号所发生的上述各项行为将视为您本人的真实意思表示。您知悉并同意，如您在账号信息的保管上、相关上网设备的网络安全维护上存在任何过失导致账号丢失、泄露，您应对此所产生的任何后果负责，平台方对此不负任何责任，如平台因此产生相关支出，平台方将有权向您予以追偿。您在使用过程中，应当及时关注平台制定、更新或者发布的各项协议和文件，（例如《隐私政策》、《评价规则》、《用户使用协议》等平台发布或者公告的文件），您在使用平台退出后再次使用账号登录平台，则视为您以及知悉相关协议的变更，并同意签署和继续使用。三、平台服务平台方将积极维护平台的正常运行，不断提升技术，提升您在使用软件时的服务体验。对您就平台服务、交易安全等相关问题所反映的客观情况和建设性建议，进行积极研究并予以改进。本协议所指达人为：在平台上展示服务/优惠信息所对应的个人、法人或者其他组织。四、达人行为规范与责任承担您清楚并知晓，您不得使用平台软件从事如下事项：1．从事违反法律法规、破坏公序良俗、损害公共利益或者他人利益的行为。2．删除许可软件及其他副本上关于版权的信息、内容。3．修改、删除或避开应用产品中平台为保护知识产权而设置的任何技术措施。4．复制、反汇编、修改许可软件或其任何部分或制造其衍生作品。5．进行任何危害信息网络安全的行为，包括使用许可软件时以任何方式损坏或破坏许可软件或使其不能运行或超负荷或干扰第三方对许可软件的使用；未经允许进入他人计算机系统并删除、修改、增加存储信息；故意传播恶意程序或病毒以及其他破坏、干扰正常网络信息服务的行为。6．利用许可软件发表、传送、传播、储存侵害他人知识产权、商业秘密权等合法权利的内容，或从事欺诈、涉黄、涉毒、盗用他人账户、资金等违法犯罪活动。7．其他以任何不合法的方式、为任何不合法的目的、或以任何与本协议不一致的方式使用许可软件。您了解并同意：1．平台方有权对您是否涉嫌违反上述使用规范做出单方认定，并根据单方认定结果中止、终止对您的使用或采取其他依约可采取的限制措施，且无须征得您的同意或提前通知予您。2．对于您使用许可软件时发布的涉嫌违法或涉嫌侵犯他人合法权利或违反本协议的信息，平台方有权不经通知您即予以删除或者永久封号。3．对于您涉嫌违反上述使用规范的行为对任意第三方造成损害的，您均应当以自己的名义独立承担所有的法律责任，并应确保平台方免于因此产生损失或增加费用。4．如您涉嫌违反有关法律或者本协议之规定，使平台方遭受任何损失，或受到任何第三方的索赔，或受到任何行政管理部门的处罚，您应当赔偿平台因此造成的损失及（或）发生的费用，包括因主张权利而支出的律师费用、调查取证费用。5．平台方有权单方面根据国家现行法律法规定或要求，以及根据平台运营需要，适时调整《用户使用协议》内容，并于发布之日生效。您确认并同意：1．您知悉并确认平台页面上展示的服务内容/优惠信息为您发布的准确信息，用户下单并支付相应的款项后，您接订单视为您与用户之间就该邀约达成合作意愿，您与用户之间成立合同关系（与平台开发方及运营方无关），合同内容为平台页面上展示的达人（您）的服务/优惠信息。2．您在接单后进入服务订单页面（具体页面内容及标题可能因网页或客户端版本不同，在不同时期而有所差异）。您应当仔细阅读服务订单页面中所包含的全部内容，包括但不限于上述服务信息中的全部内容、您要注意而标明的本单服务内容、服务有效期、选择及确认服务内容、数量、价格、应付总额、用户的联系方式或地址和服务时间等内容。前述服务订单页面中所包含的全部内容，构成了（您）达人与用户之间达成的服务合同内容，将视为用户的邀约', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-07-30 18:13:31', 5);
