INSERT INTO `sys_oper_log` VALUES (340, '静态资源', 1, 'com.ruoyi.system.controller.DdtyStaticController.add()', 'POST', 1, 'admin', NULL, '/static', '127.0.0.1', '', '{\"content\":\"<p class=\\\"ql-align-center\\\"><strong>隐私协议</strong></p><p class=\\\"ql-align-center\\\">隐私政策</p><p>&nbsp;</p><p>最后更新及生效时间： 2024年 4月10日</p><p>&nbsp;</p><p>欢迎您选择使用海南八沁网络科技有限公司（下称“我们”）旗下淘老猫平台！除《软件许可使用协议》，我们出于向您提供更优质、更便捷产品或服务的目的将通过本《隐私政策》（下称“本隐私政策”）向您进一步细化说明您在使用平台时我们收集、使用、存储个人信息的情况，以及您所享有的相关权利等事宜。请在使用我们的产品或服务前，仔细阅读并了解隐私政策，特别是加粗显示的内容。若您或您的监护人不同意本隐私政策的任何内容，您可以点击暂不同意，进入简洁模式浏览平台展示的服务或者商品。当您使用我们提供的任一产品或服务时，即表明您同意我们按照本隐私政策来合法使用和保护您的个人信息。在您同意本隐私政策后，我们将按照本隐私政策来收集、存储、使用保护您的个人信息。</p><p>&nbsp;</p><p><strong>概要</strong></p><p>&nbsp;</p><p>通过本隐私政策，您可以主要了解以下信息：</p><p>&nbsp;</p><p>&nbsp;&nbsp;&nbsp;&nbsp;我们将通过本隐私权政策向您介绍不同场景下我们如何处理个人信息。当您开启或使用淘老猫时，为实现你选择使用的功能、服务，或为遵守法律法规的要求，我们会处理相关信息。除实现基本功能、服务所需的信息，和根据法律法规要求所必需的信息外，您可以拒绝我们处理其他信息，但这可能导致我们无法提供对应功能、服务。我们将在隐私权政策中逐项说明相关情况，有关您个人信息权益的重要条款已用加粗形式提示，请特别关注。</p><p>&nbsp;</p><p>除本隐私权政策外，在特定场景下，我们还会通过即时告知（含弹窗、页面提示等）、功能更新说明等方式，向您说明对应的信息收集目的、范围及使用方式，这些即时告知及功能更新说明等构成本隐私权政策的一部分，与本隐私权政策具有同等效力。</p><p>&nbsp;</p><p>为了向您提供我们的产品或服务，优化您的用户体验，我们可能会收集您的手机号码、设备信息、服务日志信息、订单信息、位置权限、通讯录权限等，可详见下文，我们会明确向您告知收集使用该等信息的目的和方式。</p><p>&nbsp;</p><p>为保证我们产品或服务的正常运行，我们可能会接入由第三方提供的软件开发包（SDK）及其他类似程序以实现相关目的。具体查看隐私政策第七条。</p><p>&nbsp;</p><p><strong>目录</strong></p><p>&nbsp;</p><p>• 定义</p><p>&nbsp;</p><p>• 我们将如何收集和使用个人信息</p><p>&nbsp;</p><p>• 个人信息的存储及保护</p><p>&nbsp;</p><p>• 未成年人的特殊保护</p><p>&nbsp;</p><p>• 您的权利</p><p>&nbsp;</p><p>• 本隐私政策的修订和更新</p><p>&nbsp;</p><p>• 我们如何使用SDK 、Cookie技术</p><p>&nbsp;</p><p>• 您如何联系我们</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>一、定义</strong></p><p>&nbsp;</p><p>淘老猫：由海南八沁网络科技有限公司开发的，包括但不限于网页版、移动手机版、微信公众号、APP、小程序。</p><p>&nbsp;</p><p>个人信息：指以电子或者其他方式记录的能够单独或者与其他信息结合识别自然人个人身份的各种信息，包括但不限于姓名、出生日期、身份证件号码、个人生物识别信息、住址、通信通讯联系方式、通信记录和内容、行踪轨迹、交易信息等。</p><p>&nbsp;</p><p>个人敏感信息：指一旦泄露或者非法使用，容易导致自然人的人格尊严受到侵害或者人身、财产安全受到危害的个人信息，包括但不限于生物识别，宗教信仰，特定身份等信息。 &nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>二、我们将如何收集和使用个人信息</strong></p><p>&nbsp;</p><p>在您使用我们产品或服务前或使用我们产品或服务的过程中，我们将通过弹窗等方式征求您对本隐私政策同意。在您同意后，我们将会收集您在使用产品或服务时主动提供的或因使用产品或服务而产生的信息，这些信息收集的目的是向您提供、优化我', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-07-30 18:39:05', 6);
