INSERT INTO `sys_oper_log` VALUES (1290, '静态资源', 2, 'com.ruoyi.system.controller.DdtyStaticController.edit()', 'PUT', 1, 'admin', NULL, '/static', '140.240.83.100', '', '{\"content\":\"<p class=\\\"ql-align-center\\\"><strong>平台服务协议</strong></p><p>&nbsp;</p><p>最后更新和生效时间： 2024年3&nbsp;月30&nbsp;日</p><p>&nbsp;</p><p><strong>提示条款：</strong></p><p><strong>&nbsp;</strong></p><p><strong>欢迎您（“用户”）与淘老猫平台（详见定义条款）签署本《平台服务协议》（下称“本协议”）并使用淘老猫平台服务！</strong></p><p><strong>&nbsp;</strong></p><p><strong>本协议为《平台服务协议》修订版本，自本协议发布之日起，淘老猫平台各处所称“平台服务协议”均指本协议。</strong></p><p><strong>&nbsp;</strong></p><p><strong>各章节标题仅为帮助您理解该条款表达的主旨之用，不影响或限制本协议条款的含义或解释。为维护您自身权益，建议您仔细阅读各条款具体表述。</strong></p><p><strong>&nbsp;</strong></p><p><strong>您在登录流程中点击同意本协议之前，应当认真阅读本协议。请您务必阅读、理解本协议各条款内容，特别是免除或者限制责任的条款、法律适用和争议解决条款。您应重点阅读加粗显示的条款。如您对协议有任何疑问，可联系我们进行咨询。</strong></p><p><strong>&nbsp;</strong></p><p><strong>当您按照页面提示填写信息、阅读并同意本协议且完成全部流程后，即表示您已充分阅读、理解并接受本协议的全部内容，并与淘老猫达成一致，成为淘老猫平台“用户”。阅读本协议的过程中，如果您不能理解或不同意本协议或其中任一条款的约定，您应立即停止使用。</strong></p><p><strong>&nbsp;</strong></p><p><strong>由于互联网的高速发展，现有的约定可能不符合将来双方的需求，因此我们可能会修订本协议和（或）其补充协议。我们如修改本协议和（或）其补充协议，将通过页面弹窗、公告等方式通知您，请您仔细阅读并同意修改后的协议后再继续使用本软件或相关服务。</strong></p><p><strong>&nbsp;</strong></p><p><strong>请您注意，我们提供的服务属于短期工信息发布，任何满十八岁的用户都可以在淘老猫平台流量和使用短期找工信息。</strong></p><p><strong>&nbsp;</strong></p><p><strong>1.定义</strong></p><p><strong>淘老猫平台：由海南八沁网络科技有限公司（下称“我们”）开发的网络平台，包括但不限于移动端网站、微信公众号、小程序、APP。</strong></p><p><strong>&nbsp;</strong></p><p><strong>淘老猫：淘老猫平台经营者的单称或合称。</strong></p><p><strong>&nbsp;</strong></p><p><strong>淘老猫平台服务：淘老猫基于互联网，以包含淘老猫平台手机端网站、微信公众号、小程序、APP等在内的各种形态（包括未来技术发展出现的新的服务形态）向您提供的各项服务。</strong></p><p><strong>&nbsp;</strong></p><p><strong>用户：指使用淘老猫平台的任何人。</strong></p><p><strong>&nbsp;</strong></p><p><strong>2.协议适用范围</strong></p><p><strong>2.1 签约主体</strong></p><p><strong>&nbsp;</strong></p><p><strong>本协议由您与淘老猫平台经营者共同缔结，本协议对双方均具有约束力。</strong></p><p><strong>&nbsp;</strong></p><p><strong>淘老猫平台经营者是指经营淘老猫平台法律主体，您可随时查看淘老猫平台公示的证照信息以确定与您履约的主体。本协议项下，淘老猫平台经营者可能根据淘老猫平台的业