INSERT INTO `sys_oper_log` VALUES (1970, '静态资源', 2, 'com.ruoyi.system.controller.DdtyStaticController.edit()', 'PUT', 1, 'admin', NULL, '/static', '140.240.85.191', '', '{\"content\":\"<p>用户使用协议</p><p>版本日期：2024年5月1日</p><p>发布日期：2024年5月1日</p><p>使用须知：</p><p>您在注册、使用本平台时，应当仔细认真阅读《用户使用协议》（可能涉及相关方的权利义务关系的确认、责任免除或限制、法律适用与争议解决条款，请您重点阅读，对于加黑部分犹请特别关注）。本协议由海南八沁网络科技有限公司（以下也称：平台方），与您达成的关于使用淘老猫平台服务的各项条款。您点击同意本协议，即表示您已充分阅读、理解，并接受本协议的全部内容，成为淘老猫平台用户，本协议对双方均具有法律约束力。</p><p>一、账号注册</p><p>您应遵循诚实信用、合法善意的原则，向平台提交注册资料，相关注册资料应当合法合规，真实有效。如果因您所提供的注册资料不合法、不真实、不准确，从而导致相关法律责任或不利后果的，将由您承担。</p><p>二、账号使用</p><p>您可通过注册新的平台账号或登录您已有的平台账号以使用平台上现有的各项服务及功能。您应对您账号项下的所有行为（包括但不限于在线签署任何协议，浏览、购买、支付、点评、上传、发布、输入任何内容）所产生的一切后果负责，您不应当将账号借给他人使用，通过您的账号所发生的上述各项行为将视为您本人的真实意思表示。</p><p>您知悉并同意，如您在账号信息的保管上、相关上网设备的网络安全维护上存在任何过失导致账号丢失、泄露，您应对此所产生的任何后果负责，平台方对此不负任何责任，如平台因此产生相关支出，平台方将有权向您予以追偿。</p><p>您在使用过程中，应当及时关注平台制定、更新或者发布的各项协议和文件，（例如《隐私政策》、《评价规则》、《用户使用协议》等平台发布或者公告的文件），您在使用平台退出后再次使用账号登录平台，则视为您以及知悉相关协议的变更，并同意签署和继续使用。</p><p>三、平台服务</p><p>平台方将积极维护平台的正常运行，不断提升技术，提升您在使用软件时的服务体验。</p><p>对您就平台服务、交易安全等相关问题所反映的客观情况和建设性建议，进行积极研究并予以改进。</p><p>展示达人的商品或者服务信息供您选择（平台方不向您发出任何邀约或者邀约邀请）。</p><p>本协议所指达人为：在平台上展示服务/优惠信息所对应的个人、法人或者其他组织。</p><p>四、用户行为规范与责任承担</p><p>您清楚并知晓，您不得使用平台软件从事如下事项：</p><p>1．从事违反法律法规、破坏公序良俗、损害公共利益或者他人利益的行为。</p><p>2．删除许可软件及其他副本上关于版权的信息、内容。</p><p>3．修改、删除或避开应用产品中平台为保护知识产权而设置的任何技术措施。</p><p>4．复制、反汇编、修改许可软件或其任何部分或制造其衍生作品。</p><p>5．进行任何危害信息网络安全的行为，包括使用许可软件时以任何方式损坏或破坏许可软件或使其不能运行或超负荷或干扰第三方对许可软件的使用；未经允许进入他人计算机系统并删除、修改、增加存储信息；故意传播恶意程序或病毒以及其他破坏、干扰正常网络信息服务的行为。</p><p>6．利用许可软件发表、传送、传播、储存侵害他人知识产权、商业秘密权等合法权利的内容，或从事欺诈、盗用他人账户、资金等违法犯罪活动。</p><p>7．其他以任何不合法的方式、为任何不合法的目的、或以任何与本协议不一致的方式使用许可软件。</p><p>您了解并同意：</p><p>1．平台方有权对您是否涉嫌违反上述使用规范做出单方认定，并根据单方认定结果中止、终止对您的使用许可或采取其他依约可采取的限制措施，且无须征得您的同意或提前通知予您。</p><p>2．对于您使用许可软件时发布的涉嫌违法或涉嫌侵犯他人合法权利或违反本协议的信息，平台方有权不经通知您即予以删除。</p><p>3．对于您涉嫌违反上述使用规范的行为对任意第三方造成损害的，您均应当以自己的名义独立承担所有的法律责任，并应确保平台方免于因此产生损失或增加费用。</p><p>4．如您涉嫌违反有关法律或者本协议之规定，使平台方遭受任何损失，或受到任何第三方的索赔，或受到任何行政管理部门的处罚，您应当赔偿平台因此造成的损失及（或）发生的费用，包括因主张权利而支出的律师费用、调查取证费用。</p><p>5．平台方有权单方